import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <header>
        <h1>Trusted by Industry Leading Organisations</h1>
        <img src="./images/images.png" alt="Italian Trulli"/>
      </header>
    </div>
  );
}

export default App;
